import React from "react";
import styles from './mycontact.module.css';

const social_icons = [
    'fa-brands fa-linkedin',
    'fa-brands fa-facebook',
    'fa-brands fa-github'
]

const Socials = ({icons}) => {

    return(
        <i class={icons}></i>
    );
}

const MyContact = () => {

    return(
        <div className={styles.mycontact}>
            <div className={styles.contact}>
                <p className={styles.address}>
                    Address Line1: 640 Dr Mary McLeod Bethune Blvd, Daytona Beach, Florida, United States
                </p>
                <p className={styles.email}>
                    <a href="mailto:raphael.boakye@students.cookman.edu">Email: rafboah@gmail.com</a> | <a href="mailto:raphael.boakye@students.cookman.edu">raphael.boakye@students.cookman.edu</a>
                </p>
                <p className={styles.phone}>
                    Phone: (386) 310-9162
                </p>
            </div>
            <div className={styles.social_media}>
                {
                    social_icons.map(
                        (icon,index) => <Socials key={index} icons={icon}/>
                    )
                }
            </div>
        </div>
    );
}

export default MyContact;
